import React, { Component } from "react";

import ProjectNav from "./ProjectNav.js";
import "../App.css";
import "../Responsive.css";
import "../Hamburgers.css";
import img00 from "../img/schole-img00.png";
import img01 from "../img/schole-img01.png";

class Schole extends Component {
  state = {
    logoImage: img00,
  };

  componentDidMount() {
    window.scrollTo(0, 0);
  }

  render() {
    return (
      <section className="project-content schole">
        <div className="cover">
          <ProjectNav
            logoColor="#BFC1C4"
            menuColor="#BFC1C4"
            logo={this.state.logoImage}
            title={["Scholé", <br />, "Website Renewal"]}
            domain="PC / Mobile Web"
            roles="Developer: Kayla Bell"
            rolesTwo="Graphic Design: Benjamin Tribble"
            date="2016.10 - 2017.01"
            firm="ST Unitas"
          />
          <img src={img01} alt="Cover" className="cover-image" />
        </div>

        <div className="thanks">
          <div className="thanks-text">
            Checkout the Progressive Budget App below!
          </div>
          <form
            action="https://pawpalz.herokuapp.com/"
            method="get"
            target="_blank"
            className="download"
          >
            <button type="submit" className="download-button">
              BUDGET APP
            </button>
          </form>
        </div>
      </section>
    );
  }
}

export default Schole;
